    class StarcraftDefaultMemory {

        private static byte toByte1(char chr) {
            if(chr >='0' && chr<='9') {
                return (byte)((chr - '0')*16);
            } else if (chr >= 'A' && chr <= 'F') {
                return (byte)(((chr + 10) - 'A') * 16);
            } else if (chr >= 'a' && chr <= 'f') {
                return (byte)(((chr + 10) - 'a') * 16);
            } else {
                throw new NotImplementedException();
            }
        }

        private static byte toByte2(char chr) {
            if (chr >= '0' && chr <= '9') {
                return (byte)((chr - '0'));
            } else if (chr >= 'A' && chr <= 'F') {
                return (byte)(((chr + 10) - 'A'));
            } else if (chr >= 'a' && chr <= 'f') {
                return (byte)(((chr + 10) - 'a'));
            } else {
                throw new NotImplementedException();
            }
        }

        public static byte[] GetDefaultMemoryBlock(uint baseAddress, int offset, int size) {
            byte[] res = new byte[size];
            if(!DefaultMemoryBlockValues.ContainsKey(baseAddress)) {
                throw new NotImplementedException();
            }
            int maxLength = DefaultMemoryBlockValues[baseAddress].Length/2;
            if(offset+size>maxLength) {
                throw new NotImplementedException();
            }
            char[] block = DefaultMemoryBlockValues[baseAddress].Substring(offset*2,(size)*2).ToCharArray(); ;
            for (int i = 0; i < res.Length; i++) {
                res[i] = (byte)(toByte1(block[(i*2)])+toByte2(block[(i*2)+1]));
            }
            return res;
        }

